  CONSTRAINT `fk_movie_person_role` FOREIGN KEY (`person_role_id`) REFERENCES `person_role` (`person_role_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
